import Card from "./Card";
import Sdata from "./Sdata";


const Courses=()=>{
       
 return( 
       <>
  <div className="container-fluid mb-5">
    <div className="row">
    <div className="col-10 mx-auto">
    <div className="row">
  {Sdata.map((val,ind)=>{
       return<Card
       key={ind}
       imgsrc={val.imgsrc}
       title={val.title} 
       />
          }
          )
            };
            </div>
   </div>
   </div>
   </div>
    
   </>
   
   
)
  

    
};

export default Courses;
